import React from 'react';
import { motion } from 'framer-motion';
import { Star, TrendingUp, Phone, MapPin } from 'lucide-react';

const stats = [
  { icon: Star, label: '+120% 5-Star Reviews', color: 'text-yellow-400' },
  { icon: Phone, label: '+180% Phone Calls', color: 'text-primary-500' },
  { icon: MapPin, label: '+200% Direction Requests', color: 'text-primary-400' },
  { icon: TrendingUp, label: '+60% Bookings', color: 'text-green-400' },
];

const CaseStudySection = () => (
  <section id="case-study" className="section-padding bg-gray-50">
    <div className="container-custom">
      <motion.div
        initial={{ opacity: 0, y: 30 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
        className="text-center mb-12"
      >
        <h2 className="text-4xl md:text-5xl font-bold text-gray-900 mb-4">
          ðŸ“ˆ Real Results: Rankly360 Case Study
        </h2>
        <p className="text-xl text-gray-600 max-w-2xl mx-auto">
          See how our Google My Business optimization helped a local business dominate their market and drive measurable growth.
        </p>
      </motion.div>
      <div className="grid md:grid-cols-2 gap-12 items-center">
        {/* Stats & Results */}
        <motion.div
          initial={{ opacity: 0, x: -30 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <div className="bg-white rounded-2xl shadow-xl p-8 flex flex-col items-center">
            <h3 className="text-2xl font-bold text-gray-900 mb-6">Key Outcomes</h3>
            <div className="grid grid-cols-2 gap-6 mb-6">
              {stats.map((stat, i) => (
                <div key={i} className="flex items-center space-x-3">
                  <stat.icon className={`w-8 h-8 ${stat.color}`} />
                  <span className="text-lg font-semibold text-gray-800">{stat.label}</span>
                </div>
              ))}
            </div>
            <div className="bg-primary-50 rounded-xl p-4 mt-4">
              <p className="text-primary-800 font-medium italic">
                "Within 3 months, we saw a dramatic increase in calls, reviews, and new customers. Rankly360 made local SEO easy and effective!"
              </p>
              <div className="mt-2 text-right text-primary-700 font-semibold">â€” Local Business Owner</div>
            </div>
          </div>
        </motion.div>
        {/* Case Study Summary */}
        <motion.div
          initial={{ opacity: 0, x: 30 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <div className="bg-white rounded-2xl shadow-xl p-8">
            <h3 className="text-2xl font-bold text-gray-900 mb-4">Case Study: Toronto Cafe</h3>
            <p className="text-gray-700 mb-4">
              A Toronto-based cafe partnered with Rankly360 to boost their Google My Business presence. We implemented our full optimization workflow: profile tuning, weekly posts, review strategy, and local ads.
            </p>
            <ul className="list-disc list-inside text-gray-700 mb-4 text-left">
              <li>Optimized GMB profile for top local keywords</li>
              <li>Launched weekly Google Posts and photo updates</li>
              <li>Implemented review generation and response strategy</li>
              <li>Ran targeted Google Ads for local discovery</li>
            </ul>
            <p className="text-gray-700 mb-4">
              The result? Massive growth in local visibility, engagement, and revenueâ€”all tracked and reported monthly.
            </p>
            <a href="#consultation" className="inline-block mt-4 bg-primary-500 hover:bg-primary-600 text-white font-semibold px-6 py-3 rounded-lg shadow transition-colors duration-200">
              Get Results Like This
            </a>
          </div>
        </motion.div>
      </div>
    </div>
  </section>
);

export default CaseStudySection;
